SET ECHO OFF
SET VERIFY OFF
SET HEADING OFF
SET FEEDBACK OFF

SET DEFINE '^'

DEFINE pass='^1'
DEFINE tbs='^2'
DEFINE overwrite_schema='^3'

-- Exit setup script on any error
WHENEVER SQLERROR EXIT SQL.SQLCODE

rem =======================================================
rem Accept and verify schema password
rem =======================================================

-- ACCEPT pass PROMPT 'Enter a password for the user OE: ' HIDE

BEGIN
   IF '^pass' IS NULL THEN
      RAISE_APPLICATION_ERROR(-20999, 'Error: the OE password is mandatory! Please specify a password!');
   END IF;
END;
/

rem =======================================================
rem Accept and verify tablespace name
rem =======================================================
COLUMN property_value NEW_VALUE var_default_tablespace NOPRINT
VARIABLE var_default_tablespace VARCHAR2(255)
SELECT NVL( '^tbs', property_value ) as property_value FROM database_properties WHERE property_name = 'DEFAULT_PERMANENT_TABLESPACE';
DEFINE tbs='^var_default_tablespace'

rem =======================================================
rem cleanup old OE schema, if found and requested
rem =======================================================

-- ACCEPT overwrite_schema PROMPT 'Do you want to overwrite the schema, if it already exists? [YES|no]: ' DEFAULT 'YES'

SET SERVEROUTPUT ON;
DECLARE
   v_user_exists   all_users.username%TYPE;
BEGIN
   SELECT MAX(username) INTO v_user_exists
      FROM all_users WHERE username = 'OE';
   -- Schema already exists
   IF v_user_exists IS NOT NULL THEN
      -- Overwrite schema if the user chose to do so
      IF UPPER('^overwrite_schema') = 'YES' THEN
         EXECUTE IMMEDIATE 'DROP USER OE CASCADE';
         DBMS_OUTPUT.PUT_LINE('Old OE schema has been dropped.');
      -- or raise error if the user doesn't want to overwrite it
      ELSE
         RAISE_APPLICATION_ERROR(-20997, 'Abort: the schema already exists and the user chose not to overwrite it.');
      END IF;
   END IF;
END;
/
SET SERVEROUTPUT OFF;

create user OE identified by "^pass"
       default tablespace ^tbs quota unlimited on ^tbs
       account lock password expire;

GRANT CREATE TABLE,
   CREATE TYPE
TO OE;

alter session set current_schema = OE;
ALTER SESSION SET NLS_LANGUAGE=American;
ALTER SESSION SET NLS_TERRITORY=America;

--------------------------------------------------------
--  DDL for Type CUST_ADDRESS_TYP
--------------------------------------------------------

CREATE OR REPLACE EDITIONABLE TYPE "CUST_ADDRESS_TYP" 
  AS OBJECT
    ( street_address     VARCHAR2(40)
    , postal_code        VARCHAR2(10)
    , city               VARCHAR2(30)
    , state_province     VARCHAR2(10)
    , country_id         CHAR(2)
    );

/
--------------------------------------------------------
--  DDL for Type PHONE_LIST_TYP
--------------------------------------------------------

CREATE OR REPLACE EDITIONABLE TYPE "PHONE_LIST_TYP" 
  AS VARRAY(5) OF VARCHAR2(25);

/
--------------------------------------------------------
--  DDL for Table CUSTOMERS
--------------------------------------------------------

CREATE TABLE "CUSTOMERS" 
   (	"CUSTOMER_ID" NUMBER(6,0), 
	"CUST_FIRST_NAME" VARCHAR2(20), 
	"CUST_LAST_NAME" VARCHAR2(20), 
	"CUST_ADDRESS" "CUST_ADDRESS_TYP" , 
	"PHONE_NUMBERS" "PHONE_LIST_TYP" , 
	"NLS_LANGUAGE" VARCHAR2(3), 
	"NLS_TERRITORY" VARCHAR2(30), 
	"CREDIT_LIMIT" NUMBER(9,2), 
	"CUST_EMAIL" VARCHAR2(40), 
	"ACCOUNT_MGR_ID" NUMBER(6,0), 
	"CUST_GEO_LOCATION" "SDO_GEOMETRY" , 
	"DATE_OF_BIRTH" DATE, 
	"MARITAL_STATUS" VARCHAR2(20), 
	"GENDER" VARCHAR2(1), 
	"INCOME_LEVEL" VARCHAR2(20)
   ) 
 VARRAY "CUST_GEO_LOCATION"."SDO_ELEM_INFO" STORE AS SECUREFILE LOB 
 VARRAY "CUST_GEO_LOCATION"."SDO_ORDINATES" STORE AS SECUREFILE LOB ;

   COMMENT ON COLUMN "CUSTOMERS"."CUSTOMER_ID" IS 'Primary key column.';
   COMMENT ON COLUMN "CUSTOMERS"."CUST_FIRST_NAME" IS 'NOT NULL constraint.';
   COMMENT ON COLUMN "CUSTOMERS"."CUST_LAST_NAME" IS 'NOT NULL constraint.';
   COMMENT ON COLUMN "CUSTOMERS"."CUST_ADDRESS" IS 'Object column of type address_typ.';
   COMMENT ON COLUMN "CUSTOMERS"."PHONE_NUMBERS" IS 'Varray column of type phone_list_typ';
   COMMENT ON COLUMN "CUSTOMERS"."CREDIT_LIMIT" IS 'Check constraint.';
   COMMENT ON COLUMN "CUSTOMERS"."ACCOUNT_MGR_ID" IS 'References hr.employees.employee_id.';
   COMMENT ON COLUMN "CUSTOMERS"."CUST_GEO_LOCATION" IS 'SDO (spatial) column.';
   COMMENT ON TABLE "CUSTOMERS"  IS 'Contains customers data either entered by an employee or by the customer him/herself over the Web.';


/

--------------------------------------------------------
--  DDL for Table ORDERS
--------------------------------------------------------

  CREATE TABLE "ORDERS" 
   (	"ORDER_ID" NUMBER(12,0), 
	"ORDER_DATE" TIMESTAMP (6) WITH LOCAL TIME ZONE, 
	"ORDER_MODE" VARCHAR2(8), 
	"CUSTOMER_ID" NUMBER(6,0), 
	"ORDER_STATUS" NUMBER(2,0), 
	"ORDER_TOTAL" NUMBER(8,2), 
	"SALES_REP_ID" NUMBER(6,0), 
	"PROMOTION_ID" NUMBER(6,0)
   ) ;

   COMMENT ON COLUMN "ORDERS"."ORDER_ID" IS 'PRIMARY KEY column.';
   COMMENT ON COLUMN "ORDERS"."ORDER_DATE" IS 'TIMESTAMP WITH LOCAL TIME ZONE column, NOT NULL constraint.';
   COMMENT ON COLUMN "ORDERS"."ORDER_MODE" IS 'CHECK constraint.';
   COMMENT ON COLUMN "ORDERS"."ORDER_STATUS" IS '0: Not fully entered, 1: Entered, 2: Canceled - bad credit, - 3: Canceled - by customer, 4: Shipped - whole order, - 5: Shipped - replacement items, 6: Shipped - backlog on items, - 7: Shipped - special delivery, 8: Shipped - billed, 9: Shipped - payment plan,- 10: Shipped - paid';
   COMMENT ON COLUMN "ORDERS"."ORDER_TOTAL" IS 'CHECK constraint.';
   COMMENT ON COLUMN "ORDERS"."SALES_REP_ID" IS 'References hr.employees.employee_id.';
   COMMENT ON COLUMN "ORDERS"."PROMOTION_ID" IS 'Sales promotion ID. Used in SH schema';
   COMMENT ON TABLE "ORDERS"  IS 'Contains orders entered by a salesperson as well as over the Web.';
--------------------------------------------------------
--  DDL for Table ORDER_ITEMS
--------------------------------------------------------

  CREATE TABLE "ORDER_ITEMS" 
   (	"ORDER_ID" NUMBER(12,0), 
	"LINE_ITEM_ID" NUMBER(3,0), 
	"PRODUCT_ID" NUMBER(6,0), 
	"UNIT_PRICE" NUMBER(8,2), 
	"QUANTITY" NUMBER(8,0)
   ) ;

   COMMENT ON COLUMN "ORDER_ITEMS"."ORDER_ID" IS 'Part of concatenated primary key, references orders.order_id.';
   COMMENT ON COLUMN "ORDER_ITEMS"."LINE_ITEM_ID" IS 'Part of concatenated primary key.';
   COMMENT ON COLUMN "ORDER_ITEMS"."PRODUCT_ID" IS 'References product_information.product_id.';
   COMMENT ON TABLE "ORDER_ITEMS"  IS 'Example of many-to-many resolution.';
