ALTER TABLE "CUSTOMERS" ADD CONSTRAINT "CUSTOMER_PK" PRIMARY KEY ("CUSTOMER_ID");

ALTER TABLE "CATEGORIES_TAB" ADD CONSTRAINT "CATEGORY_TAB_PK" PRIMARY KEY ("CATEGORY_ID");

ALTER TABLE "ORDERS" MODIFY ("ORDER_DATE" CONSTRAINT "ORDER_DATE_NN" NOT NULL ENABLE);
ALTER TABLE "ORDERS" MODIFY ("CUSTOMER_ID" CONSTRAINT "ORDER_CUSTOMER_ID_NN" NOT NULL ENABLE);
ALTER TABLE "ORDERS" ADD CONSTRAINT "ORDER_MODE_LOV" CHECK (order_mode in ('direct','online')) ENABLE;
ALTER TABLE "ORDERS" ADD CONSTRAINT "ORDER_TOTAL_MIN" CHECK (order_total >= 0) ENABLE;
  
ALTER TABLE "ORDERS" ADD CONSTRAINT "ORDER_PK" PRIMARY KEY ("ORDER_ID")
  USING INDEX  ENABLE;

ALTER TABLE "ORDER_ITEMS" MODIFY ("LINE_ITEM_ID" NOT NULL ENABLE);
  ALTER TABLE "ORDER_ITEMS" MODIFY ("PRODUCT_ID" NOT NULL ENABLE);
  ALTER TABLE "ORDER_ITEMS" ADD CONSTRAINT "ORDER_ITEMS_PK" PRIMARY KEY ("ORDER_ID", "LINE_ITEM_ID")
  USING INDEX  ENABLE;

ALTER TABLE "PRODUCT_INFORMATION" ADD CONSTRAINT "PRODUCT_INFORMATION_PK" PRIMARY KEY ("PRODUCT_ID")
